import React from "react";


class Home extends React.Component {
    constructor(props) {
        super(props);

    }

    logOut(event) {
        event.preventDefault();
        Meteor.logout(() => {
            browserHistory.push('/login');
        });
    }

    handleClick() {
        console.log('Click happened');
    }

    render() {
        return (
            <div>
                <h2 className="text-center text-white">Logget inn som: <b>[Username]</b></h2>
                <br></br>
                <div className="d-flex flex-row bd-highlight mb-2 justify-content-center">
                    <div className="p-2">
                        <button onClick={console.log('Click happened')} type="button" className="home-button btn btn-primary btn-lg">Ny melding</button>;
                    </div>
                    <div className="p-2">
                        <button type="button" className="home-button btn btn-primary btn-lg">Aktive meldinger</button>
                    </div>
                </div>
            </div>
        );
    }
}

export default Home;
